import Card from '../UI/Card';
import classes from './Map.module.css';
import React, { useEffect } from "react";
import { render } from "react-dom";

const Map = () => {
  useEffect(() => {
    window.initMap = function() {
      // initialize Google Map here
    };

    const script = document.createElement("script");
    script.src =
      "https://maps.googleapis.com/maps/api/js?key=AIzaSyB41DRUbKWJHPxaFjMAwdrzWzbVKartNGg&callback=initMap&v=weekly";
    script.async = true;
    script.defer = true;
    document.body.appendChild(script);
  }, []);

  return (
    <div className="maps">
      <div className="topMap">
        <div id="map1" />
        <div id="map2" />
        <div id="map3" />
      </div>
      <div className="botMap">
        <div id="map4" />
      </div>
    </div>
  );
};

render(<Map />, document.getElementById("root"));

export default Map;
